function SignUp() {
  return (
    <div className="signup_box">
      <div className="signup_title">계정 만들기</div>
      <form>
        <div className="signup_input">
          <div className="signup_name"></div>
          <div className="signup_email"></div>
          <div className="signup_password"></div>
          <div className="signup_confirm_pw"></div>

          <div className="signup_btn"></div>
        </div>
      </form>
    </div>
  );
}
export default SignUp;
